import React, { Component } from 'react';
//import axios from 'axios'
import css from './index.module.scss'
class Homecheaper extends Component {

    render() {

        return (
            <div className={css.temp_list1}>
                <div className={css.temp_title}>
                    <span></span>限时特惠
                    <span className={css.line_rt}></span>
                </div>
                <ul>
                    <li></li>
                </ul>
            </div>
        )
    }
}


export default Homecheaper
